#include <iostream>

using namespace std;
#define yes cout << "YES" << endl;
#define no cout << "NO" << endl;
#define int long long
int32_t main() {
    int t;
    cin >> t;
    
    while(t --){
        int n,m;
        cin >> n >> m;
        if(m%n == 0){
            yes;
        }else{
            no;
        }
    }
    return 0;
}
